@api_view(["POST"])
def random_probes(request):
    n = request.data.get("n", 3)
    try:
        n = int(n)
    except ValueError:
        n = 3

    probes = []

    random_percentage = 0.1
    if os.environ.get("DJANGO_CONFIGURATION") == "Test":
        random_percentage = 1.0

    # Get a random list of `n` probes from the Desktop nightly table.
    aggs = DesktopNightlyAggregationView.objects.raw(
        """
        SELECT id, metric, histogram
        FROM view_glam_desktop_nightly_aggregation
        WHERE
            build_id='*'
            AND os='*'
            AND metric_key=''
            AND metric_type NOT IN ('boolean', 'histogram-boolean', 'scalar')
            AND RANDOM() < %s
        LIMIT %s
    """,
        [random_percentage, n],
    )

    for agg in aggs:
        try:
            probe = Probe.objects.get(info__name=agg.metric)
        except Probe.DoesNotExist:
            continue

        probes.append({"data": agg.histogram, "info": probe.info})

    return Response({"probes": probes})


def _log_probe_query(request):
    query = request.data["query"]
    UsageInstrumentation(
        action_type=UsageInstrumentation.ACTION_PROBE_SEARCH,
        context=query,
        tracking_id="",  # FIXME this field isn't always present. We need to find a better replacement to allow for accurate analysis
        probe_name=query["probe"],
    ).save()


@api_view(["GET"])
def usage(request):
    """
    Provides individual or aggregated (count) metrics on probe searching.

    Possible query parameters are:
    * fromDate: Date to start the search with.  Format: YYYYMMDD
    * toDate: Date to end the search with.  Format: YYYYMMDD
    * fields: Name of fields to return. See models.UsageInstrumentation for the full
            list. This parameter is needed for aggregation.
    * actionType: The type of action that triggered the metric.
            The only possible value now is: PROBE_SEARCH
    * agg: The "Aggregate" flag. The only possible value now is: count. Note that if
           "fields" is not supplied, this parameter is ignored.
    """
    if request.method == "GET":
        dimensions = []

        if q_action_type := request.GET.get("actionType"):
            dimensions.append(Q(action_type=q_action_type))
        if q_from := request.GET.get("fromDate"):
            min_date = dateutil.parser.parse(q_from)
            dimensions.append(Q(timestamp__gte=min_date))
        if q_to := request.GET.get("toDate"):
            max_date = dateutil.parser.parse(q_to)
            dimensions.append(Q(timestamp__lte=max_date))

        result = UsageInstrumentation.objects.filter(*dimensions)

        if q_fields := request.GET.get("fields"):
            fields = q_fields.split(",")
            response = result.values(*fields)
            if request.GET.get("agg") == "count":
                response = response.annotate(total=Count("*")).order_by(
                    "-total",
                )
        else:
            response = result.values("action_type", "timestamp", "probe_name")
        return Response(response, 200)

def _query_probe_job_status(probe, channel, process):
    dimensions = []
    dimensions.append(Q(probe_name=probe))
    dimensions.append(Q(channel=channel))
    dimensions.append(Q(process=process))
    return ProbeBuildJob.objects.filter(*dimensions).order_by("-timestamp").first()

@api_view(["POST"])
@renderer_classes([JSONRenderer])
def start_probe_job(request):
    params = request.data["params"]
    probe = params["probe"]
    channel = params["channel"]
    process = params["process"]
    job = _query_probe_job_status(probe, channel, process)
    if not job:
        ProbeBuildJob(
            probe_name=probe,
            channel=channel,
            process=process,
            status=ProbeBuildJob.STATUS_SUBMITTED
        ).save()

    # TODO call cloud function with query to be executed and get status. If executing, job.status = started. Else job.status = failed
    #_log_probe_query(request)
    return HttpResponseRedirect(redirect_to=f'{reverse("v1-probe-job-status")}?probe={probe}&channel={channel}&process={process}')


@api_view(["GET"])
@renderer_classes([JSONRenderer])
def probe_job_status(request):
    probe = request.GET.get("probe")
    channel = request.GET.get("channel")
    process = request.GET.get("process")
    if not probe or not channel or not process:
        raise ValidationError("Missing required parameter. [probe, channel, process]")
    result = _query_probe_job_status(probe, channel, process)
    if not result:
        raise NotFound("No job found for given probe")
    job_status = result.status
    response = {
        "status": job_status,
        "probe": probe,
        "channel": channel,
        "process": process
    }
    return Response(response)


@api_view(["POST"])
@renderer_classes([JSONRenderer])
def probe_query(request):
    """
    Expects a JSON object in the body containing the query parameters, e.g.::

        {
            "query": {
                "channel": "nightly",
                "probe": "gc_ms",
                "process": "content"
                "versions": 5,  # Defaults to 3 versions.
                "aggregationLevel": "version"  # OR "build_id"
            }
        }
        """
    def snake_case_probe(full_probe_name):
        parts =  full_probe_name.split("/")
        probe_type = parts[0]
        probe_name = parts[1].replace(".", "_").lower()
        return f"{probe_type}/{probe_name}"

    request_query = request.data["query"]
    #body.get("probename", )
    channel = request_query["channel"]
    probe = request_query["probe"]
    process = request_query["process"]
    versions = request_query["versions"]
    PROBE_INFO_SERVICE = (
        f"https://probeinfo.telemetry.mozilla.org/firefox/{channel}/main/all_probes"
    )
    with urllib.request.urlopen(PROBE_INFO_SERVICE) as url:
        data = json.loads(gzip.decompress(url.read()).decode())
        canonical_probe_names = data.keys()
        for n in canonical_probe_names:
            split_probe_name = snake_case_probe(n).split("/")
            if split_probe_name[1] == probe:
                canonical_probe_name = n
                probe_type = split_probe_name[0]
                break


        if not probe_type:
            raise NotFound(f"Probe {probe} not found on probeinfo.telemetry.mozilla.org")
        probe_search = canonical_probe_name
        data_details = data[probe_search]["history"][channel][0]["details"]
        metric_type = data_details["kind"]
        keyed = data_details["keyed"]

        bucket_details = {}
        if probe_type == "histogram":
            bucket_details = {
                "n_buckets": int(eval(str(data_details["n_buckets"]))),
                "min": int(eval(str(data_details["low"]))),
                "max": int(eval(str(data_details["high"]))),
            }

    q_params = {
            "metric": probe,
            "metric_type": metric_type,
            "process": process,
            "probe_location": f"payload.histograms.{probe}", # TODO build this dynamically according to probe type.
            "os": "Windows", # TODO replace with variable
            "channel": channel,
            "versions": versions,
        }
    q_params.update(bucket_details)

    query_str = ad_hoc_probes.query(probe_type, q_params)
    return Response({"query": query_str.replace("\n", " ")}) #todo remove \" from query and find a way to format it if you want to keep comments. I think os filter is necessary

